import React from "react";

const Steps1 = () => {
  return (
    <>
        <div className="row">
          <div className="index">
            <p>1</p>
          </div>
          <div className="steps">
            <p>Step 1 </p>
            <p>Your Info</p>
          </div>
        </div>
      
    </>
  );
};

export default Steps1;
